import React from "react";
import { Link } from "react-router-dom";

export default function QandANav() {
  return (
    <div>
      <div className="article_sub_navigation" style={articleSubNavigation}>
        <ul style={articleSubNavigationUl}>
          <li id="selected">
            <Link to="/article">HOT 10</Link>
          </li>
          <li>
            <Link to="/article">Latest</Link>
          </li>
          <li>
            <Link to="/article">Nutrition</Link>
          </li>
          <li>
            <Link to="/article">Health</Link>
          </li>
          <li>
            <Link to="/article">Beauty</Link>
          </li>
          <li style={postStyle}>
            <Link to="/QandA/post">Post Questions</Link>
          </li>
        </ul>
      </div>
    </div>
  );
}

const articleSubNavigation = {
  height: "10%",
  textAlign: "center",
};

const articleSubNavigationUl = {
  display: "inline-block",
  listStyle: "none",
  margin: "0",
  padding: "0",
};

const postStyle = {
  backgroundColor: "#FFDDA9",
  width: "230px",
  height: "60px",
  borderRadius: "90px",
  fontWeight: "bold",
  fontSize: "24px",
  textAlign: "center",
  lineHeight: "60px",
};
